    [],nt"revision_timestamp": "2016-10-03T21:22:48.812340",nt"name": "coastal-change-analysis-program-c-cap-regional-land-cover-data-and-change-data7103c",nt"isopen":
    false,nt"url": null,nt"notes": "The NOAA Coastal Change Analysis Program
    (C-CAP) produces national standardized land cover and change products for the coastal
    regions of the U.S. C-CAP products inventory coastal intertidal areas, wetlands,
    and adjacent uplands with the goal of monitoring changes in these habitats, on a
    one-to-five year repeat cycle. The timeframe for this metadata is reported as 1985
    - 2010-Era, but the actual dates of the Landsat imagery used to create the land
    cover may have been acquired a few years before or after each era. These maps are
    developed utilizing Landsat Thematic Mapper imagery, and can be used to track changes
    in the landscape through time. This trend information gives important feedback to
    managers on the success or failure of management policies and programs and aid in
    developing a scientific understanding of the Earth system and its response to natural
    and human-induced changes. This understanding allows for the prediction of impacts
    due to these changes and the assessment of their cumulative effects, helping coastal
    resource managers make more informed regional decisions. NOAA C-CAP is a contributing
    member to the Multi-Resolution Land Characteristics consortium and C-CAP products
    are included as the coastal expression of land cover within the National Land Cover
    Database.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
